import React from "react";
import "./ResultCard.css";

function ResultCard({props}){

    return(
        <div className={"resultCard"}>
            <div className={"resultCard__title"}>
                <p>{props.testTitle}</p>
            </div>
            <div className={"resultCard__marks"}>
                <div className={"resultCard__scoredMarks"}>
                    <p>Your Score: {props.scoredMarks}</p>
                </div>
                <div className={"resultCard__totalMarks"}>
                    <p>Total Score: {props.totalMarks}</p>
                </div>

            </div>

        </div>
    );
}

export default ResultCard;
